const Home = () => (
    <div>
        <h2>Welcome to the Director's App!</h2>
        <div>
            <Link to="/departments">
                <button>View Departments</button>
            </Link>
        </div>
        <div>
            <Link to="/employees">
                <button>View Employees</button>
            </Link>
        </div>
    </div>
);

const BackButton = () => (
    <div>
        <Link to="/">
            <button>Back to Home</button>
        </Link>
    </div>
);

const DepartmentListContainer = () => (
    <>
        <BackButton />
        <DepartmentList />
    </>
);

const EmployeeListContainer = () => (
    <>
        <BackButton />
        <EmployeeList />
    </>
);

export default App;
